import React from 'react'
import '../App.css';
import { SidebarData } from './SidebarData';
import { useState } from 'react';

function Home() {
    const [sidebar, setSidebar] = useState(false);
    const showSidebar = () => setSidebar(!sidebar);

    return (
        <div className="Home">
            <h2 className="Title">Home</h2>
            <p>Welcome Home</p>
        </div>
    );
}

export default Home;
